        <
        span className = "stroke-text" > Why < /span> <span> Choose us ? </span > { " " } <
        /div>{" "} <
        div className = "details-r" > { " " } <
        div >
        <
        img src = { tick }
        alt = "" / > < span > OVER 140 + EXPERT COACHES < /span>{" "} <
        /div>{" "} <
        div >
        <
        img src = { tick }
        alt = "" / > < span > TRAIN SMARTER AND FASTER THAN BEFORE < /span>{" "} <
